"subContentId\":\"2fbb329e-e69d-463d-a1f6-e0af173c44cb\"},{\"params\":{\"text\":\"<p>4- Mammals give birth to live young. They are viviparous.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5ccb5b17-17f9-415b-8890-f60f6cc12ae8\"},{\"params\":{\"text\":\"<p>5- The number of young per litter of a cow is 1 which is less than that of the mouse which is 8 (1&lt;8).</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"69aab603-a546-44b3-be07-b714cb4395e0\"},{\"params\":{\"text\":\"<p>6- The larger the size of the animal, the smaller the number of young per litter.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"74c6f56a-8db9-41b0-b411-3480a07c068c\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"1215701b-6715-447d-bfa6-20d398120fd9\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"e9beabde-5f25-4508-963f-8fb7b20522ba\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 2: Marine Mammals</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"573a5fdd-9a93-4648-9b32-09b754f25b40\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"Marine Mammals\",\"pagesList\":[{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p style=\\\"text-align:left\\\">Most mammals live on land and are called terrestrial. However, some mammals spend most of their life in water. They are called marine mammals, and they include whales, seals, dolphins, sea otters, and sea lions.</p>\\n\\n<p style=\\\"text-align:left\\\">While they look like fish, these animals have several characteristics that set them apart from fish. </p>\\n\\n<p style=\\\"text-align:left\\\">While swimming underwater, they can hold their breath for a long period of time, then they go to the surface of water to breathe air through their lungs.  </p>\\n\\n<p style=\\\"text-align:left\\\">Their babies are born live and are fed milk by their mothers.</p>\\n\\n<p style=\\\"text-align:left\\\">They are warm-blooded animals. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"f5531663-d117-49f5-a529-ccd07487821e\"},{\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4QyyRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAfAAAAcgEyAAIAAAAUAAAAkYdpAAQAAAABAAAAqAAAANQACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIDI0LjMgKFdpbmRvd3MpADIwMjM6MTA6MDMgMTI6MzM6MDMAAAAAAAOgAQADAAAAAf//AACgAgAEAAAAAQAABRSgAwAEAAAAAQAAAeMAAAAAAAAABgEDAAMAAAABAAYAAAEaAAUAAAABAAABIgEbAAUAAAABAAABKgEoAAMAAAABAAIAAAIBAAQAAAABAAABMgICAAQAAAABAAALeAAAAAAAAABIAAAAAQAAAEgAAAAB/9j/7QAMQWRvYmVfQ00AAv/uAA5BZG9iZQBkgAAAAAH/2wCEAAwICAgJCAwJCQwRCwoLERUPDAwPFRgTExUTExgRDAwMDAwMEQwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwBDQsLDQ4NEA4OEBQODg4UFA4ODg4UEQwMDAwMEREMDAwMDAwRDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDAwMDP/AABEIADsAnwMBIgACEQEDEQH/3QAEAAr/xAE/AAABBQEBAQEBAQAAAAAAAAADAAECBAUGBwgJCgsBAAEFAQEBAQEBAAAAAAAAAAE ning characters: @chars\",\"taskDescription\":\"<p>1- List examples of marine mammals.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"9ec078fc-2ecd-44b8-aa0a-062f0b0b09f0\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>2- How do marine mammals breathe? Compare the respiration of marine mammals to that of fish.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"6e9538ec-4631-485a-a8d8-6b5bb6433bea\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3- How are young marine mammals born? Compare it to how fish are born. </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"94af5625-a880-4e87-989b-2382be29460d\"},{\"params\":{\"inputFieldSize\":\"3\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4- Is the body temperature of marine mammals similar to that of fish? Justify your answer.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"74717bff-f42e-42e4-bafd-bf3913b0e6e4\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Problem\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Problem\"},\"subContentId\":\"e0016412-c5c4-49c4-adcd-f37a69d9d1f7\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1-  Marine mammals include whales, dolphins, seals, sea otters, and sea lions.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"bd4d5705-2c0a-49ce-843e-e930977b1a45\"},{\"params\":{\"text\":\"<p>2- Fish breathe oxygen from water with their gills, while mammals breathe oxygen from air with their lungs.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b10fdc91-9166-4de0-aae5-7d1928fdc7aa\"},{\"params\":{\"text\":\"<p>3- Marine mammals are viviparous. Their babies are born live and drink milk from their mother for several months. However, fish are oviparous. The females lay their eggs in the water and abandon them.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a6218ca1-416f-484b-a722-eb11a35680da\"},{\"params\":{\"text\":\"<p>4- Like all mammals, marine mammals are warm-blooded animals, while fish are cold-blooded.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a6d3bb66-7a7e-4aaa-aafb-68b31b17ca4d\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"472d9e5b-fe5e-4515-a590-324423932241\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"b5b05139-f399-41e1-889c-d59acbc5e979\"},\"useSeparator\":\"auto\"},{\ d\":\"54d5bbb0-5bc1-40ad-aef3-b24fbc418c5b\"},{\"params\":{\"text\":\"<p>Penguins have feathers that help them stay warm and help them swim. </p>\\n\\n<p>They have beaks that they use to catch and eat fish, and they breathe air through their lungs.</p>\\n\\n<p>Penguins have wings, but they are adapted for swimming rather than flying. They use their wings like flippers to propel themselves through the water. While they can't fly in the air, they are excellent swimmers!</p>\\n\\n<p>They lay one or two eggs at a time and incubate them until they are ready to hatch. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"4e24ba42-2e47-4e62-9d98-6a7c84b23ff1\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Are penguins fish, mammals, or birds? </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"c28bcbca-29b5-4e07-b1ad-0b7f60ff1218\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>1. Extract from the text the characteristics that make penguins belong to the bird family.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"aca80ea7-bb04-44c1-9faf-c3600c796b90\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>3. What makes penguins different from mammals? Give two characteristics.</p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"2ba6192c-baef-4270-9396-1b231cf4aa65\"},{\"params\":{\"inputFieldSize\":\"1\",\"requiredField\":false,\"remainingChars\":\"Remaining characters: @chars\",\"taskDescription\":\"<p>4. What makes penguins different from fish? Give two characteristics. </p>\\n\"},\"library\":\"H5P.TextInputField 1.2\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\"},\"subContentId\":\"5938ef8a-6f79-46e9-9294-d5fbe23e37b8\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Questions\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Questions\"},\"subContentId\":\"1cdc1ea8-0b3c-41cc-a6a2-e27b61cca1c8\"},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>1. Penguins are birds. </p>\\n\\n<p>2. Penguins have the characteristics of birds. They have feathers, a beak, and wings that they use as flippers. They lay eggs from which their babies hatch. </p>\\n\\n<p>3. A penguin's body is covered with feathers, while a mammal's body is covered with hair. Penguins lay eggs, while mammals give birth to live babies. </p>\\n\\n<p>4. Penguins breathe air through their lungs, while fish take in oxygen from water through their gills. Penguins lay one or two eggs that they incubate until they hatch, while fish lay many eggs that they abandon. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"5d1ba13b-0424-4c5c-9d4c-5964117271c8\"}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"efc13a5a-c495-46a6-a7f8-11e8ed5a3b4c\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Documentation Tool\"},\"subContentId\":\"9defc245-e41f-4722-b920-a8206009c14a\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Problem 4: The Venn Diagram</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"df5e411e-47d4-4c5c-8fb8-b7edc85eb9e1\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"The Venn Diagram\",\"pagesList\":[{\"params\":{\"helpTextLabel\":\"More information\",\"helpText\":\"\",\"elementList\":[{\"params\":{\"text\":\"<p>A Venn Diagram is a graphical representation of similarities and differences between groups. It is made with overlapping circles. Each circle represents a different group with its characteristics. The overlapping sections represent their shared characteristics.</p>\\n\\n<p>Look at the Venn diagram below and answer the questions that follow. </p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"a0ade4c3-228b-4b57-8401-285a381f92c9\"},{\"params\":{\"decorative\":false,\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAABSwAAAG9CAYAAAAfnjgRAAAACXBIWXMAAAsTAAALEwEAmpwYAAANIWlUWHRYTUw6Y29tLmFkb2JlLnhtcAAAAAAAPD94cGFja2V0IGJlZ2luPSLvu78iIGlkPSJXNU0wTXBDZWhpSHpyZVN6TlRjemtjOWQiPz4gPHg6eG1wbWV0YSB4bWxuczp4PSJhZG9iZTpuczptZXRhLyIgeDp4bXB0az0iQWRvYmUgWE1QIENvcmUgOS4wLWMwMDEgNzkuYzAyMDRiMiwgMjAyMy8wMi8wOS0wNjoyNjoxNCAgICAgICAgIj4gPHJkZjpSREYgeG1sbnM6cmRmPSJodHRwOi8vd3d3LnczLm9yZy8xOTk5LzAyLzIyLXJkZi1zeW50YXgtbnMjIj4gPHJkZjpEZXNjcmlwdGlvbiByZGY6YWJvdXQ9IiIgeG1sbnM6eG1wPSJodHRwOi8vbnMuYWRvYmUuY29tL3hhcC8xLjAvIiB4bWxuczpkYz0iaHR0cDovL3B1cmwub3JnL2RjL2VsZW1lbnRzLzE ification:</p>\\n\\n<p>The three groups have different body coverings. Mammals have hair. Birds have feathers, and fish have scales. The body coverings are different for all the three groups. Each body covering is written in the circle of the corresponding group. <br />\\n<br />\\nMammals are the only viviparous animals among the three groups. This is why \\\"viviparous\\\" is written in the green circle.<br />\\n<br />\\nFish are the only cold-blooded and the only animals that have gills among the three groups. This is why these characteristics are in the orange circle. <br />\\n<br />\\nBirds and mammals are warm-blooded and have lungs. This is why these 2 characteristics are in Zone 1.<br />\\n<br />\\nBirds and fish are oviparous. This is why this characteristic is in Zone 3.<br />\\n<br />\\nAll three groups are vertebrates. This characteristic is in Zone 4 which is common to the three groups.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"b66e3365-f56b-4a74-abc2-d3dac246712d\"}]},\"library\":\"H5P.StandardPage 1.5\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Answer\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Answer\"},\"subContentId\":\"8146ab26-7533-4a74-9f1a-9721a2137c25\"}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"metadata\":{\"contentType\":\"Documentation Tool\",\"license\":\"U\",\"title\":\"Untitled Documentation Tool\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Documentation Tool\"},\"subContentId\":\"4bff9af3-0e31-4046-96cd-c9406d8828b3\"},\"useSeparator\":\"auto\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"I solve complex problems","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"
